Dana jest dodatnia liczba całkowita $n$. \textit{Kwadratem nordyckim} nazywamy tablicę $n \times n$ wypełnioną wszystkimi liczbami całkowitymi od $1$ do $n^2$ w taki sposób, że w każde pole wpisana jest dokładnie jedna liczba. Dwa różne pola \textit{sąsiadują}, jeśli mają wspólny bok. Każde pole sąsiadujące wyłącznie z polami zawierającymi większe liczby nazywamy \textit{doliną}. Ciąg jednego lub więcej pól tablicy nazywamy \textit{ścieżką pod górkę}, jeśli spełnia następujące warunki:
(i) pierwsze pole w tym ciągu jest doliną;
(ii) każde kolejne pole w tym ciągu sąsiaduje z poprzednim;
(iii) liczby wpisane w pola tego ciągu są uporządkowane rosnąco.
Wyznaczyć, w zależności od $n$, najmniejszą możliwą łączną liczbę ścieżek pod górkę w kwadracie nordyckim.

